import React, {Component} from 'react';
import AppNav from "./AppNav";
import { Container } from 'reactstrap';
import bgimage01 from './assets/bg-image01.png';


class Home extends Component {

    render() { 
        return ( 
            <div>
                <Container>
                <AppNav />
                </Container>
                <Container>
                    <div>
                        <h1> Hello</h1>
                    </div>
                </Container>
            </div>
         );
    }
}

export default Home;
